;; **
;;; 
;;; #### As long as possible
;;; 
;;; Another simple looping macro is referred as _as long as possible_ (or _alap_ for short). As the name suggests, it (recursively) executes a given sequence of operations as long as possible, i.e., as long as the resulting _grape_ is not empty.
;;; 
;;; The concrete syntax of the _alap_ macro uses the `->*` symbol and has the general form `(->* start op1 op2 .. opm)`, where `start` is an input grape and `op1 op2 .. opm` are again operations on _grapes_.
;;; 
;;; Consider the following example, where we first generate a graph with 3 `Hello` nodes and then use the _alap_ operator to apply rule `world` as often as possible: (which is also 3 times)
;; **

;; @@
(-> (newgrape) 
  (->n* 3 hello)
  (->* world)
  view)
;; @@
