;; <=

;; **
;;; The Sirpinski evolution algorithm needs to transform triangles in _phases_, i.e., the current evolution phase must first transform all triangles created in the previous phase before transforming the triangles created in the current phase. One approach to achieve this (using regular, sequential graph transformations) is to mark newly created triangles in order to exclude them from transformation until the end of a phase, and then remove these markers before starting with the next phase. 
;;; 
;;; However, given that the derivations of the rule `step` are parallel independent, we can use _GrapeVine_'s parallel rule application operator to achieve this phased transformation behaviour. The following  program computes four evolution steps of the Sirpinski triangles
;; **

;; @@
(def g0 (-> (newgrape) setup))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;tutorial2/g0</span>","value":"#'tutorial2/g0"}
;; <=

;; @@
(println "**1") (time (step* g0))  (def g1 _)
(println "**2") (time (step* g1))  (def g2 _)
(println "**3") (time (step* g2)) (def g3 _)
(println "**4") (time (step* g3))  (def g4 _)
(println "**5") (time (step* g4))  (def g5 _)
(println "**6") (time (step* g5))   (def g6 _)
(println "**7") (time (step* g6))  (def g7 _)
(println "**8") (time (step* g7))   (def g8 _)
(println "**9") (time (step* g8))  (def g9 _)
(println "**10") (time (step* g9))  (def g10 _)
(println "**11") (time (step* g10))  (def g11 _)
(println "**12") (time (step* g11))  (def g12 _)
(println "**13") (time (step* g12))  (def g13 _)
(println "**14") (time (step* g13))  (def g14 _)
