;; <=

;; **
;;; However, if we wanted to use regular Neo4J tools (like the Neo4J browser) to further process this graph, this cannot easily be done, since the graph is "burried" in its history graph. This is illustrated with the following screenshot of the regular Neo4J browser, which shows the internal history graph structure for this example:
;;; 
;;; <img src="https://github.com/jenshweber/grape/blob/master/help/neobrowse1.png?raw=true" width="95%"/>
;;; 
;;; Instead of 2 nodes and 1 edge, we see 9 nodes and many more edges(!) These extra graph elements are used to maintain the version information for _GrapeVine_. (The left-most blue node shows the empty graph generated by `newgrape` and the remaining three blue nodes represent the graphs generated by the three subsequent transformations.)
;;; 
;;; Any single version graph can be exported as a _projection_ of the multiversion (history) graph. The `harvest` function performs this operation.
;;; 
;;; > Note: The `harvest` function should normally be passed _grapes_ that contain single graphs only. If the _grape_ given to the `harvest` function contains multiple graphs, it will pick one of them.
;;; 
;; **

;; @@
(-> (newgrape) hello world vine (harvest "mygraph"))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-string'>&quot;mygraph&quot;</span>","value":"\"mygraph\""}
;; <=

;; **
;;; The resulting graph is a _regular_ Neo4J graph. It is completely independent of any _GrapeVine_ multiversion graph. Nodes that belong to it are identified by a "marker" node of type `__View`, which has a name attribute set tot the string given to the `harvest` function call ("mygraph" in this example).
;;; 
;;; The resulting graph can easily be retrieved with the following Cypher query:
;;; 
;;; ``` 
;;;  MATCH (v:`__View`{name:"mygraph"}) 
;;;  with * OPTIONAL MATCH (v)-[:c]->(n1) 
;;;  WITH * OPTIONAL MATCH (n1)-[e]->(n2) 
;;;  RETURN n1, n2, e
;;; ```
;;; 
;;; Let's see the result of this in the Neo4J browser:
;;; 
;;; <img src="https://github.com/jenshweber/grape/blob/master/help/neobrowse2.png?raw=true" width="70%"/>
;; **

;; **
;;; As we can see, the resulting graph is identical to the graph we wanted to extract (up to isomorphism).
;;; 
;;; > Warning: Calling the `harvest` function will delete any previously "harvested" graph with the same name. 
;; **

;; **
;;; Of course, there are many tools other than the Neo4J browser that can be used for graph processing and visualization. For example, one such tool is the open source tool [NeoDash](https://github.com/neo4j-labs/neodash), which can be used to [create and share](https://neo4j.com/labs/neodash/2.2/user-guide/publishing/) sophisticated graph visualization and analysis dashboards.
;;; 
;;; ![](https://dist.neo4j.com/wp-content/uploads/20211215102547/0DA4luc7CydpjJAYL.png)
;; **

;; **
;;; ### Import
;;; 
;;; _GrapeVine_ also provides an import operation, which is capable of importing regular Neo4J graphs into a multi-version graph (i.e, essentially performing the reverse operation of what `harvest` does). Keeping with the theme of growing _grapes_ (and avoiding name conlficts with other Clojure functions), the import operation is called `plant`.
;;; 
;;; Analogously to `harvest` (which marks all nodes that are part of the exported graph with a named "marker" node), `plant` expects that the nodes that belong to the graph to be imported are marked with a named "marker" node of type `__View`. This means that all nodes are important that this marker node points to with a `c` edge. Any edges between these nodes are implicitly imported.
;;; 
;;; We will just demonstrated the use of `plant` with the regular graph we just imported above:
;; **

;; @@
(plant "mygraph")
;; @@
;; =>
;;; {"type":"list-like","open":"<span class='clj-list'>(</span>","close":"<span class='clj-list'>)</span>","separator":" ","items":[{"type":"html","content":"<span class='clj-string'>&quot;c9968577-60bb-403a-bafa-09fb62b3e5b9&quot;</span>","value":"\"c9968577-60bb-403a-bafa-09fb62b3e5b9\""}],"value":"(\"c9968577-60bb-403a-bafa-09fb62b3e5b9\")"}
;; <=

;; **
;;; As we can see, `plant` returns a _grape_ with a single graph that we can transform and view as shown earlier, for example by adding a `Hello` node:
;; **

;; @@
(-> (plant "mygraph") hello view)
